mso-bidi-language:AR-SA&quot; lang=&quot;IN&quot;&gt;Pada September 2017, tingkat ketimpangan pengeluaran
penduduk Maluku Utara yang diukur oleh &lt;i style=&quot;mso-bidi-font-style:normal&quot;&gt;Gini
Ratio&lt;/i&gt; adalah sebesar 0,330 meningkat sebesar 0,013 poin dari kondisi Maret
